import { useState } from "react";
import { Menu, X, ChevronDown, ChevronUp } from "lucide-react"; // Add ChevronDown and ChevronUp for dropdown arrows
import "./Navbar.css";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [isSolutionOpen, setIsSolutionOpen] = useState(false); // State for Solution dropdown
  const [isProductsOpen, setIsProductsOpen] = useState(false); // State for Products dropdown

  return (
    <nav className="navbar">
      <div className="nav-container">
        <h1 className="logo">Brand</h1>
        <button className="menu-icon" onClick={() => setIsOpen(!isOpen)}>
          {isOpen ? <X /> : <Menu />}
        </button>
        <ul className={`nav-links ${isOpen ? "open" : ""}`}>
          <li><a href="#home">About Us</a></li>

          {/* Solution Dropdown */}
          <li 
            className="dropdown"
            onClick={() => setIsSolutionOpen(!isSolutionOpen)}
          >
            <a href="#solution">Solution</a>
            <span className="dropdown-arrow" color="">
              {isSolutionOpen ? <ChevronUp /> : <ChevronDown />}
            </span>
            {isSolutionOpen && (
              <ul className="dropdown-menu">
                <li><a href="#solution1">Solution 1</a></li>
                <li><a href="#solution2">Solution 2</a></li>
                <li><a href="#solution3">Solution 3</a></li>
              </ul>
            )}
          </li>

          {/* Products Dropdown */}
          <li 
            className="dropdown"
            onClick={() => setIsProductsOpen(!isProductsOpen)}
          >
            <a href="#products">Products</a>
            <span className="dropdown-arrow">
              {isProductsOpen ? <ChevronUp /> : <ChevronDown />}
            </span>
            {isProductsOpen && (
              <ul className="dropdown-menu">
                <li><a href="#product1">Product 1</a></li>
                <li><a href="#product2">Product 2</a></li>
                <li><a href="#product3">Product 3</a></li>
              </ul>
            )}
          </li>

          <li><a href="#services">Case</a></li>
          <li><a href="#contact">Contact</a></li>
          <li><a href="#language">Language</a></li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
